addOperation.body:
@Operation setUpdate[monitor=false,delToClassAllowed=false]():XCore::Element
  let min = 0;
      hour = 9;
      sec = 0
  in Challenge.classes->select(i |
       i.isKindOf(FMML::MetaClass))->collect(i |
       min := (min + 1).mod(60);
     sec := (sec + 12).mod(60);
     i.lastUpdated := Auxiliary::Date::createDateAndTime(2022,5,5,hour,min,sec))
  end
end

@Operation successors[monitor=false,delToClassAllowed=false]():XCore::Element
  let succEvent = self.getRegularEventAct();
      act = Seq{}
  in if succEvent <> null
     then if succEvent.getActivityTriggers() <> null
          then act := act.including(succEvent.getActivityTriggers())
          elseif succEvent.getSynch() <> null
          then act := act.including(succEvent.getSynch().getSynchedActivity())
          else act := succEvent.getFork().getActivitys().asSeq()
          end 
     else false
     end ;
     act
  end
end
